Винтажный ассам🥃
⠀
🔸2 пакетика Ronnefeldt Teavelope® Assam
🔸или 2 чайных ложки листового Ronnefeldt Black Assam Flowery Orange Pekoe;
🔸400 мл кипятка;
🔸100 мл коричневого рома;
🔸4 чайные ложки коричневого сахара;
🔸2 ломтика апельсина для подачи.
⠀
Заварите чай в 400 мл кипятка в течении 3 минут. Добавьте сахар, перемешайте. Долейте ром.
⠀
Наполните получившимся грогом две прозрачных высоких чашки или стакана, украсьте дольками апельсина. ⠀
Теперь холод вам не страшен😉

🍗Куриные ножки в чайно-лимонном маринаде.
⠀
🍴На 4 порции: ⠀
1 столовая ложка Ronnefeldt Sencha или 2 пакетика Ronnefeldt Teavelope® Classic Green;
1 лайм;
4 куриные ножки; 
20 г топленого сливочного масла;
250 г риса басмати;
1 пучок зеленого лука;
1 небольшой перец чили;
1/2 пучка мяты, мелиссы или кинзы;
соль;
свежемолотый перец.
⠀
Шаг 1:
Заварите чай в 500 мл воды 80° С и настаивайте 3 минуты. Затем процедите и дайте остыть. Вымойте лайм, просушите, нарежьте тонкими ломтиками и добавьте в чай.
⠀
Шаг 2:
Вымойте куриные ножки и промокните бумажным полотенцем. Натрите солью и перцем. Нагрейте топленое масло. Обжарьте куриные ножки на среднем огне с двух сторон до золотистой корочки. Затем залейте маринадом и тушите около 20 минут на среднем огне. Приправьте солью и перцем по вкусу
⠀
Шаг 3:
Очистите зеленый лук и перец чили, вымойте, промокните насухо, мелко нарежьте.
⠀
Шаг 4:
Приготовьте рис согласно инструкциям на упаковке. Не забудьте посолить. За 5 минут до готовности добавьте в рис зеленый лук и перец чили.
⠀
Шаг 5:
Отделите листья мяты, мелиссы или кинзы от стеблей, вымойте, высушите и измельчите. ⠀
Шаг 6:
Выложите куриные ножки с соусом на тарелку с рисом. Посыпьте травой по вкусу.
